import image1 from "../assets/t-image1.jpg";
import image2 from "../assets/t-image2.jpg";
import image3 from "../assets/t-image1.png";

export const testimonialsData = [
  {
    image: image1,
    review:
      "I made the right choice by choosing the Fitclub and by choosing the right plan and program I already achieved my ideal body!",
    name: 'LOUAY ZAARA',
    status : 'ENTREPRENEUR'
  },
  {
    image: image2,
    review: 'I wasnt so sure about the idea of getting the ideal body, but Wooooh-ohhhh Those plans has seriously made me achieve the goal',
    name: 'HOUSSEM DHOUIBI',
    status: 'CUSTOMER'
  },
  {
    image : image3,
    review:'The best coach you can hope for which by training with him day after day it became more alike a friendship then coach/customer relationship',
    name: 'FRANKLIN',
    status: 'CUSTOMER'
  }
];
